import React from "react";

function Experiences() {
  return (
    // starting div for corys experiences
    <div className="cory-experiences">
      <h2>Cory's Experiences</h2>

      <table>
        <tr>
          <th>Experiences</th>
        </tr>
      </table>
    </div>
    // ending div for corys experiences
  );
}

export default Experiences;
